# Alembic configuration file
#
# This file is used by Alembic to determine how to run migrations.
#
# sqlalchemy.url is set to a dummy value, but your Flask app should set DB URL from env/config.

[alembic]
script_location = migrations
sqlalchemy.url = postgresql://ras_user:ras_password@localhost:5432/ras_database

[loggers]
keys = root,sqlalchemy,alembic

[handlers]
keys = console

[formatters]
keys = generic

[logger_root]
